import { Link,useNavigate } from "react-router-dom";
import React, {useState} from "react";
import {useDispatch} from 'react-redux';
import {signup} from "../../redux/actions/auth";

import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import AppBar from '@mui/material/AppBar';
import { Toolbar } from "@mui/material";
import Grid from '@mui/material/Grid';



function Signup() {
	const nagivate = useNavigate();
    const dispatch = useDispatch();

    const [inputs, setInputs] = useState({
		username: '',
		email: '',
		password: '',
		confirmPassword: ''
	})

	const { username, email, password } = inputs;

	console.log(inputs.username);

    const onChange = (e) => {setInputs({ ...inputs, [e.target.name]: e.target.value})};

	function handleOnSubmit(e) {
        e.preventDefault();
        if (inputs.username !== "" && inputs.password !== "" && inputs.confirmPassword !== "" && inputs.email !== "" && inputs.password === inputs.confirmPassword && inputs.password.length >= 4) {
            dispatch(signup(inputs,nagivate))
        }
    }

	const googleAuth = () => {
		window.open(
			`http://localhost:8080/auth/google/callback`,
			"_self"
		);
	};



	return (
		<div >
			<AppBar position="fixed">
            <Toolbar>
            <Typography variant="h6" noWrap component="div">
              Welcome!
            </Typography>

            </Toolbar>

          </AppBar>

			<Card variant="outlined" sx={{ mt:16, pt:3, mx:40, pb:40}} >

			<h1 >Sign up Form</h1>
			<div >
				<div >
				</div>
				<div >
					<h2 >Create Account</h2>
					<input  onChange={(e) => onChange(e)} type="text" placeholder="Username" name="username" />
					<input  onChange={(e) => onChange(e)} type="text" placeholder="Email" name="email"/>
					<input  onChange={(e) => onChange(e)} type="password" placeholder="Password"/>
					<input  onChange={(e) => onChange(e)} type="password" placeholder="retype your password"/>

					<button onClick={handleOnSubmit}  >Sign Up</button>

					<p >or</p>
					<button  onClick={googleAuth}>
						<span>Sing up with Google</span>
					</button>
					<p >
						Already Have Account ? <Link to="/login">Log In</Link>
					</p>
				</div>
			</div>
			</Card>
		</div>
	);
}

export default Signup;
